// src/pages/AddItem.tsx

import React, { useState, useEffect } from "react";
import axios from "../utils/axiosInstance";
import { IItem, INewItem } from "../types";
import { useNavigate, useParams } from "react-router-dom";

// Import MUI components
import {
  Container,
  TextField,
  Button,
  Typography,
  Box,
  Alert,
  CircularProgress,
} from "@mui/material";

const AddItem: React.FC = () => {
  const navigate = useNavigate();
  const { branchId } = useParams<{ branchId: string }>(); 

  // State to manage the new item
  const [item, setItem] = useState<INewItem>({
    name: "",
    description: "",
    quantity: 0,
    price: 0,
    branch: branchId || "", 
  });

  const [error, setError] = useState<string | null>(null);
  const [loading, setLoading] = useState<boolean>(false);

  useEffect(() => {
    if (!branchId) {
      setError("Branch ID is missing. Cannot add item.");
    } else {
      setItem((prevItem) => ({
        ...prevItem,
        branch: branchId,
      }));
    }
  }, [branchId]);

  // Handle input changes
  const handleChange = (
    e: React.ChangeEvent<HTMLInputElement | HTMLTextAreaElement>
  ) => {
    const { name, value } = e.target;

    setItem((prevItem) => ({
      ...prevItem,
      [name]: name === "quantity" || name === "price" ? Number(value) : value,
    }));
  };

  // Handle form submission
  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();
    setError(null);

    // Basic form validation
    if (!item.name.trim()) {
      setError("אנא הכנס שם תקין");
      return;
    }

    if (item.quantity <= 0) {
      setError("הכמות צריכה להיות יותר גדולה מ0");
      return;
    }

    if (!item.branch) {
      setError("מזהה של הסניף חסר");
      return;
    }

    setLoading(true);

    try {
      // Post the new item to the specific branch
      const response = await axios.post<IItem>(
        `/api/${item.branch}/items`,
        item
      );
      console.log("Item added:", response.data);
      navigate(`/branch/${item.branch}/items`); 
    } catch (err: any) {
      console.error("Error adding item:", err);
      setError(
        err.response?.data?.message || "Failed to add item. Please try again."
      );
    } finally {
      setLoading(false);
    }
  };


  if (error && !loading) {
    return (
      <Container maxWidth="sm">
        <Box sx={{ mt: 4 }}>
          <Typography variant="h4" align="center" gutterBottom>
            הכנס מוצר חדש
          </Typography>
          <Alert severity="error" sx={{ mb: 2 }}>
            {error}
          </Alert>
          <Button
            variant="contained"
            color="primary"
            onClick={() => navigate(-1)}
          >
            חזור
          </Button>
        </Box>
      </Container>
    );
  }

  return (
    <Container maxWidth="sm">
      <Box sx={{ mt: 4 }}>
        <Typography variant="h4" align="center" gutterBottom>
          הכנס מוצר חדש
        </Typography>
        {error && (
          <Alert severity="error" sx={{ mb: 2 }}>
            {error}
          </Alert>
        )}
        <Box component="form" onSubmit={handleSubmit} noValidate>
          <TextField
            label="שם המוצר"
            name="name"
            value={item.name}
            onChange={handleChange}
            fullWidth
            required
            margin="normal"
          />
          <TextField
            label="תיאור"
            name="description"
            value={item.description}
            onChange={handleChange}
            fullWidth
            multiline
            rows={4}
            margin="normal"
          />
          <TextField
            label="כמות"
            name="quantity"
            value={item.quantity}
            onChange={handleChange}
            type="number"
            fullWidth
            required
            margin="normal"
            inputProps={{ min: 1 }}
          />
          <TextField
            label="מחיר"
            name="price"
            value={item.price}
            onChange={handleChange}
            type="number"
            fullWidth
            margin="normal"
            inputProps={{ min: 0, step: 0.01 }}
          />
          <Button
            type="submit"
            variant="contained"
            fullWidth
            sx={{
              mt: 3,
              backgroundColor: "#333333", // Dark background color
              color: "#ffffff", 
              "&:hover": {
                backgroundColor: "#555555", // Slightly lighter dark on hover
              },
            }}
            disabled={loading}
          >
            {loading ? <CircularProgress size={24} /> : "הכנס מוצר חדש"}
          </Button>
        </Box>
      </Box>
    </Container>
  );
};

export default AddItem;
